import { Button } from "../Portal";

const Charg_Three = ({ thing }) => {
  return (
    <section className="pagecenter-x padding-y">
      <div className="text-center">
        <h2>{thing.title}</h2>
        {thing.subtitle ||
          (thing.button && (
            <Button to={thing.button.to} label={thing.button.label} />
          ))}
      </div>
    </section>
  );
};

export default Charg_Three;
